def print_landmarks(x,y,n,c,bd,tloc,loc_list):
    
    for loc,coords in loc_list:
        ix,iy = mapgen.icoords(coords)
        if not args.mute :
            while loc.count(" ")>0 :
                loc = loc.replace(" ","_")
            while loc.count("♥")>0 :
                loc = loc.replace("♥","[love_interest]")
            print("!l",ix,iy,loc,end=endchar)    
   
def find_lift(x,y,n,c,bd,tloc,tags_list,internat_road_list):
    
    # This is the format
    # > lifts;
    # ┌
    # │ !l {ix} {iy} {ix2} {iy2};
    # │   :                               # (ix,iy) is the integer-valued center tile (lower)
    # │   :                               # (ix2,iy2) is the integer-valued target tile (higher)
    # └
    
    icoords = []
    for ix,iy in zip(x,y):
        icoords += [mapgen.icoords((ix,iy))]
    
    # get the segments
    lift_coords = []
    for road in internat_road_list:
        # convert to int
        for i in range(len(road)-1):
            v1 = mapgen.icoords(road[i])
            v2 = mapgen.icoords(road[i+1])
            i1 = icoords.index(v1)
            i2 = icoords.index(v2)
            if "highland" in tags_list[i1] and "highland" not in tags_list[i2] :
                lift_coords += [(v2,v1)]
            if "highland" in tags_list[i2] and "highland" not in tags_list[i1] :
                lift_coords += [(v1,v2)]
    
    if not args.mute :
        digits = 4
        for elem in lift_coords:
            print("!l",*elem[0],*elem[1], end=endchar)
    
