def tile_analyzer(x,y,n,c,bd,tloc,road_list,interroad_list,rivers):
    
    # use segments instead!!!
    road_segments = []
    for nat in road_list:
        for twn in road_list[nat]:
            road = road_list[nat][twn]
            for i in range(len(road)-1):
                if (road[i],road[i+1]) not in road_segments:
                    road_segments += [ (road[i],road[i+1]) ]
    for road in interroad_list:
        for i in range(len(road)-1):
            if (road[i],road[i+1]) not in road_segments:
                road_segments += [ (road[i],road[i+1]) ]
    road_segments = [ (mapgen.icoords(v1),mapgen.icoords(v2)) for v1,v2 in road_segments]
    
    river_segments = []
    for river in rivers:
        for i in range(len(river)-1):
            if (river[i][:2],river[i+1][:2]) not in river_segments:
                river_segments += [ (river[i][:2],river[i+1][:2]) ]
    river_segments = [ (mapgen.icoords(v1),mapgen.icoords(v2)) for v1,v2 in river_segments]
    
    def same_segment(segment1,segment2):
        revsegment1 = (segment1[1],segment1[0])
        return segment1==segment2 or revsegment1==segment2
    def contain_segment(segment,seglist):
        for segtest in seglist:
            if same_segment(segment,segtest) :
                return True
        return False

    # get road tiles and river tiles
    city_tiles = [ mapgen.icoords(tloc[key]) for key in tloc ]
    road_tiles = []
    for v1,v2 in road_segments:
        if v1 not in road_tiles:
            road_tiles+=[v1]
        if v2 not in road_tiles:
            road_tiles+=[v2]
    river_tiles = []
    for v1,v2 in river_segments:
        if v1 not in river_tiles:
            river_tiles+=[v1]
        if v2 not in river_tiles:
            river_tiles+=[v2]
    special_tiles = list(set(road_tiles+river_tiles))
    special_tiles = [ v for v in special_tiles if v not in city_tiles ]
    
    used_seeds = []
    for v in special_tiles:
        nbs = mapgen.get_nb(v)
        exit_options = ""
        for i,nb in enumerate(nbs):
            if contain_segment((v,nb),road_segments):
                exit_options+=str(i+1)
        nroad = len(exit_options)

        river_exit_options = ""
        nb_river_out = []
        for i,nb in enumerate(nbs):
            if contain_segment((v,nb),river_segments):
                river_exit_options += str(i+1)
                nb_river_out  += [nb]
        nriver = len(river_exit_options)
        
        if nriver>0:
            min_node = None
            min_h = 99999
            for x,y,h in sum(rivers,[]):
                u = mapgen.icoords((x,y))
                if u in nb_river_out:
                    if h <= min_h:
                        min_h = h
                        min_node = u
            # determine which river exit we are talking about here
            river_out = river_exit_options[nb_river_out.index(min_node)]
        else:
            river_out = ""
        used_seeds = plot_tile(exit_options,river_exit_options,v,
                                args.plot,used_seeds,river_out)

def city_analyzer(x,y,n,c,bd,tloc,road_list,interroad_list,rivers):
    
    # use segments instead!!!
    road_segments = []
    for nat in road_list:
        for twn in road_list[nat]:
            road = road_list[nat][twn]
            for i in range(len(road)-1):
                if (road[i],road[i+1]) not in road_segments:
                    road_segments += [ (road[i],road[i+1]) ]
    for road in interroad_list:
        for i in range(len(road)-1):
            if (road[i],road[i+1]) not in road_segments:
                road_segments += [ (road[i],road[i+1]) ]
    road_segments = [ (mapgen.icoords(v1),mapgen.icoords(v2)) for v1,v2 in road_segments]
    
    river_segments = []
    for river in rivers:
        for i in range(len(river)-1):
            if (river[i][:2],river[i+1][:2]) not in river_segments:
                river_segments += [ (river[i][:2],river[i+1][:2]) ]
    river_segments = [ (mapgen.icoords(v1),mapgen.icoords(v2)) for v1,v2 in river_segments]
    
    def same_segment(segment1,segment2):
        revsegment1 = (segment1[1],segment1[0])
        return segment1==segment2 or revsegment1==segment2
    def contain_segment(segment,seglist):
        for segtest in seglist:
            if same_segment(segment,segtest) :
                return True
        return False

    used_seeds = []
    for key in tloc:
        v = mapgen.icoords(tloc[key])
        if len(key.split("|"))>1:
            t = key.split("|")[0]
            nat = key.split("|")[1]
            is_capital = key.split("|")[3] == "*"
            
            nbs = mapgen.get_nb(v)
            exit_options = ""
            for i,nb in enumerate(nbs):
                if contain_segment((v,nb),road_segments):
                    exit_options+=str(i+1)
            nroad = len(exit_options)

            river_exit_options = ""
            nb_river_out = []
            for i,nb in enumerate(nbs):
                if contain_segment((v,nb),river_segments):
                    river_exit_options += str(i+1)
                    nb_river_out  += [nb]
            nriver = len(river_exit_options)
            
            if nriver>0:
                min_node = None
                min_h = 99999
                for x,y,h in sum(rivers,[]):
                    u = mapgen.icoords((x,y))
                    if u in nb_river_out:
                        if h <= min_h:
                            min_h = h
                            min_node = u
                # determine which river exit we are talking about here
                river_out = river_exit_options[nb_river_out.index(min_node)]
            else:
                river_out = ""
            
            used_seeds = plot_city(exit_options,river_exit_options,v,
                                    is_capital,t,args.plot,used_seeds,river_out)
            
