def plot_city(exit_options,river_exit_options,city_tile,is_capital,name,plotfig=True,used_seeds=[],river_out=""):

    # This is the format
    #
    # {seed};
    # > tiles;
    # ┌
    # │{i} {j} {tag};
    # │ :   :    :
    # │ :   :    :
    # └
    # > mountains;
    # ┌
    # │{i} {j};
    # │ :   :
    # │ :   :
    # └
    # > city tiles;
    # ┌
    # │{i} {j} {city name};
    # │ :   :   :
    # │ :   :   :
    # └
    # > village tiles;
    # ┌
    # │{i} {j};
    # │ :   :
    # │ :   :
    # └
    # > city interiors;
    # ┌
    # │ ${city name};
    # │ !c {x} {y} {dirx} {diry};                 (castle coords)
    # │┌
    # ││!r {x1} {y1} {x2} {y2};                   (road segments)
    # ││ :  :    :    :    :
    # ││ :  :    :    :    :
    # │└
    # │┌
    # ││!w {x1} {y1} {x2} {y2};                   (wall segments)
    # ││ :  :    :    :    :
    # ││ :  :    :    :    :
    # │└
    # │┌
    # ││!s {x1} {y1} {x2} {y2} {tags} {type};     (building segments)
    # ││ :  :    :    :    :     :      :         (tag = i/o as in inner/outer)
    # ││ :  :    :    :    :     :      :         (type = building name)
    # │└
    # │┌
    # ││!n {x} {y} {dirx} {diry} {tags} {type};   (building nodes)
    # ││ :  :   :    :      :      :      :
    # ││ :  :   :    :      :      :      :
    # │└
    # │┌
    # ││!x {x} {y} {tags};                        (intersection)
    # ││ :  :   :    :
    # ││ :  :   :    :
    # │└
    # │┌
    # ││!k {x1} {y1} {x2} {y2};                   (river segments)
    # ││ :  :    :    :    :
    # ││ :  :    :    :    :
    # │└
    # └
    #    :
    #    :
    # > special tiles;
    # ┌
    # │ .... (see plot_tile)
    # └
    #    :
    #    :

    x,y = city_tile
    seed = global_seed + 1000*(x+100) + (y+100)    
    output, seed = citygen.generate_city(exit_options,river_exit_options,not is_capital,seed,used_seeds=used_seeds,river_out=river_out)
    used_seeds += [seed]

    # output = [ castle_roads,
    #            inner_roads,
    #            outer_roads,
    #            exit_roads,
    #            castle_walls,
    #            inner_walls,
    #            outer_walls,
    #            grid_corners,
    #            buildings,
    #            ob_regtype,
    #            building_types,
    #            rivers]

    castle_road_segments = output[0]
    inner_road_segments = output[1]
    outer_road_segments = output[2]
    exit_road_segments = output[3]

    castle_wall_segments = output[4]
    inner_wall_segments = output[5]
    outer_wall_segments = output[6]
    grid_segments = output[7]

    building_segments_inner = output[8][0]
    building_nodes_inner    = output[8][1]
    intersection_inner      = output[8][2]
    building_segments_outer = output[8][3]
    building_nodes_outer    = output[8][4]
    intersection_outer      = output[8][5]
    building_size_inner  = output[8][6]
    building_size_outer  = output[8][7]
    
    buiding_segment_regtype, buiding_node2_regtype = output[9]
    ibs_type, ibn_type, obs_type, obn_type = output[10]

    river_segments  = output[11]

    road_segments = sum(output[:4],[])
    wall_segments = sum(output[4:6+1],[])

    castle_wall_nodes = sum([ list(segment) for segment in castle_wall_segments ],[])
    if castle_road_segments[0][0] not in castle_wall_nodes:
        castle_node = castle_road_segments[0][0]
        other_node = castle_road_segments[0][1]
    else:
        castle_node = castle_road_segments[0][1]
        other_node = castle_road_segments[0][0]
    direction = tuple(np.array(other_node)-np.array(castle_node))
    castle_node = [ (castle_node,direction) ]
    
    if not args.mute :
        print("$"+name, end=endchar)
        digits = 4
        
        # Used symbol
        
        node, direction = castle_node[0]
        nodex,nodey = node
        dirx,diry = direction
        node = [ round(x,digits) for x in (nodex,nodey,dirx,diry) ]
        print("!c",*node, end=endchar)

        for segment in road_segments:
            p1,p2 = segment
            segment = [ round(x,digits) for x in (*p1,*p2) ]
            print("!r",*segment, end=endchar)
        for segment in wall_segments:
            p1,p2 = segment
            segment = [ round(x,digits) for x in (*p1,*p2) ]
            print("!w",*segment, end=endchar)

        for segment,type in zip(building_segments_inner,ibs_type):
            p1,p2 = segment
            segment = [ round(x,digits) for x in (*p1,*p2) ]
            print("!s",*segment,"i",type, end=endchar)
        for segment,regtype,type in zip(building_segments_outer,buiding_segment_regtype,obs_type):
            p1,p2 = segment
            segment = [ round(x,digits) for x in (*p1,*p2) ]
            if regtype=="dark" :
                tags = "d"
            elif regtype=="adv" :
                tags = "a"
            elif regtype=="shp" :
                tags = "s"
            else:
                tags = "b"
            print("!s",*segment,tags,type, end=endchar)
        for node2, type in zip(building_nodes_inner,ibn_type):
            node,direction = node2
            nodex,nodey = node
            dirx,diry = direction
            node = [ round(x,digits) for x in (nodex,nodey,dirx,diry) ]
            print("!n",*node,"i",type, end=endchar)
        for node2,regtype,type in zip(building_nodes_outer,buiding_node2_regtype,obn_type):
            node,direction = node2
            nodex,nodey = node
            dirx,diry = direction
            if regtype=="dark" :
                tags = "d"
            elif regtype=="adv" :
                tags = "a"
            elif regtype=="shp" :
                tags = "s"
            else:
                tags = "b"
            node = [ round(x,digits) for x in (nodex,nodey,dirx,diry) ]
            print("!n",*node,tags,type, end=endchar)
        for nodex,nodey in intersection_inner:
            node = [ round(x,digits) for x in (nodex,nodey) ]
            print("!x",*node,"i", end=endchar)
        for nodex,nodey in intersection_outer:
            node = [ round(x,digits) for x in (nodex,nodey) ]
            print("!x",*node,"o", end=endchar)
            
        for segment in river_segments:
            p1,p2 = segment
            segment = [ round(x,digits) for x in (*p1,*p2) ]
            print("!k",*segment, end=endchar)

    if plotfig :
        # Plots ===============================================

        scale = 8
        scale2 = scale**2

        fig = plt.figure(figsize=(4*scale,4*scale))
        xyrange = (-1,1)
        plt.xlim(*xyrange)
        plt.ylim(*xyrange)
        
        border_color = "lightgray"
        road_color = "darkgray"
        wall_color = "blue"
        building_castle = "lightskyblue"
        building_inner = "lightskyblue"
        building_base = "palegreen"
        building_dark = "gray"
        building_adv = "salmon"
        building_shp = "wheat"
        river_color = "dodgerblue"
        
        # border plot
        for segment in grid_segments:
            plt.plot(*xy(segment),color=border_color,linewidth=1.0*scale)

        # roads
        for segment in road_segments:
            plt.plot(*xy(segment),color=road_color,linewidth=1.5*scale)

        # walls
        for segment in wall_segments:
            plt.plot(*xy(segment),color=wall_color,linewidth=1.0*scale)

        # rivers
        for segment in river_segments:
            plt.plot(*xy(segment),color=river_color,linewidth=1.5*scale)
            
        # inner buildings
        bd_width = 24
        for node2 in building_nodes_inner:
            plt.scatter(*xy([node2[0]]),color=building_inner, marker='h',s=bd_width*scale2,zorder=2)
        for segment,size in zip(building_segments_inner,building_size_inner):
            bdcolor = building_inner
            plt.plot(*xy(segment),color=bdcolor,linewidth=2.5*scale)
        plt.scatter(*xy(intersection_inner),color=road_color, marker='h',s=bd_width*scale2,zorder=2)
        plt.scatter(*xy(intersection_inner),color="white", marker='h',s=4*scale2,zorder=3)
        
        # outer buildings
        for node2, regtype in zip(building_nodes_outer,buiding_node2_regtype):
            if regtype=="dark":
                bdcolor = building_dark
            elif regtype=="shp":
                bdcolor = building_shp
            elif regtype=="adv":
                bdcolor = building_adv
            else:
                bdcolor = building_base
            plt.scatter(*xy([node2[0]]),color=bdcolor, marker='h',s=bd_width*scale2,zorder=2)
        for segment,size,regtype in zip(building_segments_outer,building_size_outer,buiding_segment_regtype):
            if regtype=="dark":
                bdcolor = building_dark
            elif regtype=="shp":
                bdcolor = building_shp
            elif regtype=="adv":
                bdcolor = building_adv
            else:
                bdcolor = building_base
            plt.plot(*xy(segment),color=bdcolor,linewidth=2.5*scale)
        plt.scatter(*xy(intersection_outer),color=road_color, marker='h',s=bd_width*scale2,zorder=2)
        plt.scatter(*xy(intersection_outer),color="white", marker='h',s=4*scale2,zorder=3)
        
        plt.scatter(*xy(castle_node,True),color=building_castle, marker='h',s=32*scale2,zorder=2)
        



        # display building names
        def segment_loc(segment):
            v1,v2 = segment
            return tuple((np.array(v1)+np.array(v2))/2)
        def node2_loc(node2):
            return node2[0]
        building_coords = (
            [ segment_loc(s) for s in building_segments_inner ]
            +[ node2_loc(s) for s in building_nodes_inner ]
            +[ segment_loc(s) for s in building_segments_outer ]
            +[ node2_loc(s) for s in building_nodes_outer ]
        )
        building_types = ibs_type+ibn_type+obs_type+obn_type
        
        building_coords = [castle_node[0][0]]+building_coords
        building_types = ["castle"]+building_types

        for coords, bname in zip(building_coords,building_types):
            while bname.count("_")>0:
                bname = bname.replace("_","\n")
            plt.text(*coords,bname,fontsize=1.5*scale,fontweight="bold",va="center",ha="center",zorder=3,rotation=15)

        showfig("city_"+name,fig)
    return used_seeds

def plot_tile(exit_options,river_exit_options,tile,plotfig=True,used_seeds=[],river_out=""):

    # This is the format
    # > special tiles;
    # ┌
    # │ $tile {x} {y};
    # │┌
    # ││!r {x1} {y1} {x2} {y2};                   (road segments)
    # ││ :  :    :    :    :
    # ││ :  :    :    :    :
    # │└
    # │┌
    # ││!k {x1} {y1} {x2} {y2};                   (river segments)
    # ││ :  :    :    :    :
    # ││ :  :    :    :    :
    # │└
    # └
    #    :
    #    :

    x,y = tile
    seed = global_seed + 1000*(x+100) + (y+100)
    
    output, seed = citygen.generate_tile(exit_options,river_exit_options,seed,used_seeds=used_seeds)

    used_seeds += [seed]

    # output = [ roads ]

    road_segments = output[0]
    river_segments = output[1]
    grid_segments = output[2]

    if not args.mute :
        print("$tile "+str(tile[0])+" "+str(tile[1]), end=endchar)
        digits = 4
        
        for segment in road_segments:
            p1,p2 = segment
            segment = [ round(x,digits) for x in (*p1,*p2) ]
            print("!r",*segment, end=endchar)
        for segment in river_segments:
            p1,p2 = segment
            segment = [ round(x,digits) for x in (*p1,*p2) ]
            print("!k",*segment, end=endchar)
        
    if False :
    #if plotfig :
        # Plots ===============================================

        scale = 8
        scale2 = scale**2

        fig = plt.figure(figsize=(4*scale,4*scale))
        xyrange = (-1,1)
        plt.xlim(*xyrange)
        plt.ylim(*xyrange)
        
        border_color = "lightgray"
        road_color = "darkgray"
        river_color = "blue"
        

        # roads
        for segment in road_segments:
            plt.plot(*xy(segment),color=road_color,linewidth=1.5*scale)
        for segment in river_segments:
            plt.plot(*xy(segment),color=river_color,linewidth=2.0*scale)

        # border plot
        for segment in grid_segments:
            plt.plot(*xy(segment),color=border_color,linewidth=1.0*scale)
            
        showfig("tile"+str(tile),fig)
    return used_seeds

def showfig(fname,fig,clean=True):
    if clean:
        plt.axis('off')
        plt.subplots_adjust(left=0, right=1, top=1, bottom=0)
    plt.savefig("output/"+fname+'.png')
    fig.clear()
    plt.close()
    pass

def xy(coords,end_node=False):
    if end_node :
        X = []
        Y = []
        shift_scale = 0.0
        for v1,v2 in coords:
            X+=[v1[0]+shift_scale*v2[0]]
            Y+=[v1[1]+shift_scale*v2[1]]
    else:
        X = [ x for x,y in coords ]
        Y = [ y for x,y in coords ]
    return X,Y

